import styled from "styled-components";
import ReactCalendar from 'react-calendar'

const Calendar = () => {
    let now = new Date();
    let todayDate = now.getDate()
	return (
		<CalendarPadding>
            <p> {todayDate} </p>
        </CalendarPadding>
	);
};

export default Calendar;

const CalendarPadding = styled.div`
	padding-top: 40px;
	padding-left: 30px;
	padding-right: 30px;
	padding-bottom: 20px;
	// border-bottom: 2px solid #e9ecef;
`;
